using ACME.Products.Categories;
using ACME.Products.ProductCategories;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Volo.Abp.Data;
using Volo.Abp.DependencyInjection;
using Volo.Abp.Domain.Repositories;

namespace ACME.Products.Products
{
    public class ProductsSeedContributor : IDataSeedContributor, ITransientDependency
    {
        readonly IRepository<Product> _productsRepository;
        readonly IRepository<Category> _categoriesRepository;
        const string category1 = "Clothes";
        const string category2 = "Shoes";
        public ProductsSeedContributor(IRepository<Product> productsRepository, IRepository<Category> categoriesRepository)
        {
            _productsRepository = productsRepository;
            _categoriesRepository = categoriesRepository;
        }
        public async Task SeedAsync(DataSeedContext context)
        {
            await CreateSampleCategoriesAsync();
            await CreateSampleProductsAsync();
        }


        private async Task CreateSampleProductsAsync()
        {
            var categories = (await _categoriesRepository.GetListAsync(a => a.CategoryName == category1 || a.CategoryName == category2));
            var data = new List<Product>()
            {
                new Product
                {

                    ProductCategories = new List<ProductCategory>
                    {
                        new ProductCategory
                        {
                            CategoryId = categories.FirstOrDefault(a=>a.CategoryName == category1).Id
                        }
                    },
                    ProductName = "T-shirt",
                    Price = 150,
                    PublishDate = null,
                    UnitsInStock = 10,
                    Picture = Convert.FromBase64String(""),

                },
                new Product
                {
                     ProductCategories = new List<ProductCategory>
                    {
                        new ProductCategory
                        {
                            CategoryId = categories.FirstOrDefault(a=>a.CategoryName == category2).Id
                        }
                    },
                     ProductName = "Brown Shoes",
                    Price = 350,
                    PublishDate = null,
                    UnitsInStock = 10,
                    Picture = Convert.FromBase64String("")
                }

            };
            var existProducts = (await _productsRepository.GetListAsync(exist => data.Select(added => added.ProductName).Contains(exist.ProductName), includeDetails: true));
            var existNames = existProducts.Select(a => a.ProductName);
            var addedProducts = data.Where(added => !existNames.Contains(added.ProductName));
            await _productsRepository.InsertManyAsync(addedProducts, autoSave: true);
            existProducts.ForEach(product =>
            {
                var migratedProduct = data.FirstOrDefault(migrated => migrated.ProductName == product.ProductName);
                product.ProductName = migratedProduct.ProductName;
                product.Price = migratedProduct.Price;
                product.PublishDate = migratedProduct.PublishDate;
                product.UnitsInStock = migratedProduct.UnitsInStock;
                product.Picture = migratedProduct.Picture;
                if(!product.ProductCategories.Any(exist => exist.CategoryId == migratedProduct.ProductCategories.FirstOrDefault().CategoryId))
                    product.ProductCategories.Add(new ProductCategory { CategoryId = migratedProduct.ProductCategories.FirstOrDefault().CategoryId });
            });


        }

        private async Task CreateSampleCategoriesAsync()
        {
            var data = new List<Category>()
            {
                new Category
                {
                    CategoryName = category1,
                    Description = "In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before final copy is available. It is also used to temporarily replace text in a process called greeking, which allows designers to consider the form of a webpage or publication",
                    ParentCategoryId =0,
                    Picture = Convert.FromBase64String(""),

                },
                new Category
                {
                    CategoryName =category2,
                    Description = "In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before final copy is available. It is also used to temporarily replace text in a process called greeking, which allows designers to consider the form of a webpage or publication",
                    ParentCategoryId =0,
                    Picture = Convert.FromBase64String("")
                }

            };
            var existNames = (await _categoriesRepository.GetListAsync(exist => data.Select(added => added.CategoryName).Contains(exist.CategoryName))).Select(a => a.CategoryName);
            await _categoriesRepository.InsertManyAsync(data.Where(added => !existNames.Contains(added.CategoryName)), autoSave: true);


        }
    }
}
